import React from "react";
import "./ZipCodePage.css"; // Your CSS file for styling

const ZipCodePage = ({ nextStep, updateFormData }) => {
  const [zipCode, setZipCode] = React.useState("");
  const [error, setError] = React.useState("");

  const handleInputChange = (e) => {
    setZipCode(e.target.value);
    setError(""); // Clear error on input change
  };

  const handleSubmit = () => {
    if (/^\d{5}$/.test(zipCode)) {
      updateFormData("zipCode", zipCode); // Save data
      nextStep(); // Go to the next step
    } else {
      setError("Please enter a valid US ZIP Code");
    }
  };

  return (
    <div className="zip-code-container">
      {/* SVG Logo */}
      <div className="logo-container">
        <svg
          height="33"
          viewBox="0 0 152 33"
          width="152"
          xmlns="http://www.w3.org/2000/svg"
          xmlnsXlink="http://www.w3.org/1999/xlink"
        >
          <filter id="a" color-interpolation-filters="auto">
            <feColorMatrix
              in="SourceGraphic"
              values="0 0 0 0 0.000000 0 0 0 0 0.200000 0 0 0 0 0.627451 0 0 0 1.000000 0"
            />
          </filter>
          <g
            fill="none"
            fillRule="evenodd"
            filter="url(#a)"
            transform="translate(-100 -25)"
          >
            <path
              d="m148.927 27.812h-.364v.85h.343c.314 0 .509-.134.509-.425 0-.28-.173-.425-.488-.425zm.739 2.472-.833-1.23h-.27v1.186h-.479v-2.875h.843c.585 0 .974.3.974.838 0 .414-.215.682-.562.795l.801 1.174zm-.727-3.69c-1.169 0-2.097.826-2.097 2.304 0 1.463.928 2.292 2.097 2.292 1.18 0 2.11-.829 2.11-2.292 0-1.478-.94-2.305-2.11-2.305zm0 4.899c-1.446 0-2.454-1.042-2.454-2.595 0-1.545 1.026-2.61 2.454-2.61 1.45 0 2.455 1.053 2.455 2.61 0 1.545-1.028 2.595-2.455 2.595zm-126.817-13.688h-7.467c.465-.766 7.467-12.539 7.467-12.539v12.54zm-3.188-17.804-18.934 31.49h6.437s4.669-7.839 4.83-8.107h10.865l.004 8.111 6.11-.001v-31.494h-9.312zm13.646-.001v31.495h5.938v-31.494zm10.26 0h5.929v31.495h-5.929zm18.997 16.621c-3.23-.872-3.905-1.362-3.82-2.753.07-1.262 1.063-1.988 2.722-1.988 2.052 0 4.561.748 6.717 2l.34.201.817-5.255-.193-.095c-2.214-1.045-4.864-1.602-7.681-1.602-2.711 0-5.016.866-6.505 2.434-1.178 1.251-1.783 2.87-1.752 4.669.103 4.856 2.34 6.23 7.639 7.639 3.504.894 4.215 1.425 4.19 3.153-.02 1.554-.916 2.14-3.299 2.14-2.492 0-5.302-.95-7.74-2.599l-.354-.243-.823 5.275.177.1c1.898 1.08 5.141 2.214 8.56 2.214 3.314 0 5.761-.812 7.275-2.395 1.18-1.242 1.76-2.921 1.733-5.005-.077-5.215-2.62-6.454-8.003-7.89"
              fill="#0033a0"
              transform="translate(100.334297 25.381008)"
            />
          </g>
        </svg>
      </div>

      {/* ZIP Code Form */}
      <h1>Find the lowest car insurance rates in your area!</h1>
      <div className="zip-code-box">
        <label htmlFor="zipCode">What is your ZIP Code?</label>
        <input
          type="text"
          id="zipCode"
          placeholder="ZIP Code"
          value={zipCode}
          onChange={handleInputChange}
        />
        <button onClick={handleSubmit}>Start Now</button>
        {error && <p className="error-message">{error}</p>}
      </div>
    </div>
  );
};

export default ZipCodePage;
